INSERT INTO `reports` (`id`, `title`, `title_ja`, `date_time`, `author`, `issue`, `attend_person`, `attend_other_person`, `language`, `translatable`, `type`, `content`, `content_ja`, `seen`, `created_at`, `updated_at`) VALUES
(8, 'Thư mục &quot;2004-3&quot; cho các món ăn thông thường trên Xserve đã biến mất', 'Xserve上の常備菜「2004-3」フォルダが無くなりました', '2020-03-20 14:44:00', '8', '60', NULL, NULL, 'ja', 1, 'Trouble', '<h4><strong>Nội dung của sự cố</strong></h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Thư mục \"2004-3\" chứa các tệp InDesign cho Tsukibina 4-3 đã biến mất.</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Kết thúc công việc vào ngày 11 tháng 3, nó đã có trên máy chủ.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Có một cuộc trở lại trường học vào ngày 18 tháng 3, và khi tôi cố gắng làm việc, tôi nhận ra rằng thư mục [4-3] đã biến mất.</span></li></ul><p style=\"margin-left:40px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;xserve</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">　├pal_works</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">　├JOBISAI_kilala</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">　　├Job</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├01_Rule</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├02_Backnumber</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├03_Feedback</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├04_Schedule</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├05-Completed</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-3(edit)　←Thư mục này đã bị xóa</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-4</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-5&nbsp;</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi nghi ngờ thư mục có thể đã được di chuyển và tôi đã tìm kiếm theo tên thư mục (nơi tôi đã tìm kiếm: Xserve, Xserve6, local local) nhưng không thể tìm thấy thư mục.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi đã trình báo với Vương và nhờ tìm kiếm nhưng không thấy.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi đã tóm tắt dữ liệu đã gửi trong BOX và hướng dẫn chỉnh sửa cho đến nay, và thực hiện lại từ tạo mới cho đến trước khi quay lại trường một lần nữa. Chúng tôi đã so sánh tệp đã được làm lại và tệp PDF đã được gửi tới BOX và xác nhận rằng không có sự khác biệt.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đến khoảng 11h ngày 18/3, khi tìm tên hồ sơ trên máy tính của Vy thì có một tài liệu đã được sửa lại bằng cách quay lại trước giờ học. Tôi đã xuất tệp PDF và xác nhận rằng nó không khác với tệp đã gửi.</span></li></ul><h4>Nguyên nhân của rắc rối</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi đã tìm kiếm nó vì tôi đã di chuyển nó đến một vị trí khác trên máy chủ, nhưng nó không có ở đó. Có vẻ như khi nhiều công việc chồng chéo lên nhau, một thành viên trong nhóm đã vô tình xóa nó đi và không để ý. Đó là một thành viên của nhóm DTP có quyền xóa thư mục, nhưng không ai nhớ đã xóa nó.</span></p><h4>Làm cách nào để cải thiện</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Một nhóm DTP sẽ tổ chức một buổi học về cách xử lý các thư mục trên máy chủ.</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nếu lỡ xóa hoặc di chuyển dữ liệu trên Xserve, hãy báo ngay cho Wan để khôi phục dữ liệu (* Trường hợp này, thông báo mất dữ liệu đã quá muộn). Tôi không thể phục hồi).</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nếu không thể khôi phục được, trước tiên hãy tìm kiếm máy chủ và máy tính cá nhân theo tên thư mục hoặc tên tệp.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nếu nó không được tìm thấy ở bất cứ đâu, hãy bắt đầu lại.</span></li></ul><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Kể từ bây giờ, người điều hành và người quản lý tiến độ sẽ luôn lưu trữ dữ liệu sao lưu trên máy tính cá nhân của họ.</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trước khi người vận hành làm việc, hãy sao chép dữ liệu thực phẩm thông thường của Xserve vào máy tính cá nhân và sửa lại trên máy tính cá nhân.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Người vận hành tải dữ liệu đã chỉnh sửa lên Xserve sau khi làm việc. Nếu có chỉnh sửa thêm sau khi tải lên, tôi sẽ sửa lại dữ liệu trên máy tính cá nhân của mình và tải lên Xserve. Bằng cách làm này, cùng một dữ liệu mới nhất vẫn còn trên PC của nhà điều hành và Xserve. Quy trình làm việc này cũng giống như đối với Tutsione.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trình quản lý tiến độ lưu tệp InDesign mới nhất trên PC của anh ấy trước khi gửi cho người chỉnh sửa của YUIDEA. Bằng cách này, người vận hành và người quản lý tiến độ sẽ lưu dữ liệu mới nhất cho nhau và ngay cả khi dữ liệu của Xserver bị mất, dữ liệu của máy tính cá nhân vẫn có thể được sử dụng để tiếp tục.</span>&nbsp;<br>&nbsp;</li></ul>', '<h4>トラブルの内容</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">常備菜4-3のInDesignファイルが入った「2004-3」フォルダが無くなりました。</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">3月11日の作業が終わった時点では、サーバーにありました。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">3月18日に再校戻しがあり、作業しようとしたら、【4-3】フォルダが無くなったのに気が付きました。</span></li></ul><p style=\"margin-left:40px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;xserve</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">├pal_works</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">├JOBISAI_kilala</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">　　├Job</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├01_Rule</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├02_Backnumber</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├03_Feedback</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├04_Schedule</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├05-Completed</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-3(edit)　←このフォルダが削除された</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-4</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├2004-5&nbsp;</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">フォルダが移動された可能性を考え、フォルダ名で検索しました（検索したところは：Xserve, Xserve6, 個人のローカル）が、フォルダを見つけられませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">ワンに報告して、検索してもらいましたが、それでも見つかりませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">BOXにある入稿データと今までの修正指示をまとめ、新規作成から再校前戻しまでやり直しました 。やり直したファイルとBOXに提出したPDFとを比べ、異なっていないことを確認しました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">3月18日11時ごろ、VyさんのPCでファイル名を検索すると、再校前戻しで修正したドキュメントがありました。PDFを書き出し、提出したファイルと比べ、異なっていないことを確認しました。</span></li></ul><h4>トラブルの原因</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">サーバー上の別の場所に移動させたのかと考え、検索しましたが、ありませんでした。 いろいろな作業が重なった際に、メンバーの誰かがうっかりして削除し、気が付かなかったというのが原因だと思われます。フォルダを削除する権限があるのは、DTPチームのメンバーですが、だれも削除した記憶がありません。&nbsp;</span></p><h4>改善方法</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">サーバー上のフォルダの取り扱い方法について、DTPチームで勉強会を行います。</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;Xserveのデータを間違って削除や移動などの操作をしてしまったら、データを回復するために直ぐにワンに報告する（※今回の場合は、データがなくなった事に気が付いたのが遅かったためデータを回復出来なかった）。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;回復出来ない場合は、最初にフォルダ名やファイル名などでサーバーと個人PCで検索する。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">どこにもなかった場合には、最初から作り直す。</span></li></ul><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;今後は、オペレーターと進行管理者はいつも個人PCにバックアップのデータを保存します。</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレーターが作業する前にXserveの常備菜データを個人PCにコピーし、個人のPCで修正する。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレータは、作業後に、修正したデータをXserveにアップする。アップ後に追加の修正があれば、個人PCのデータを改めて修正し、Xserveにアップする。こうすることで、オペレータのPCとXserveに同じ最新のデータが残る。この作業フローはツチオネと同じである。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">進行管理者は、YUIDEAの編集者へ提出する前に、最新のInDesignファイルを自分のPCに保存する。こうすることで、オペレーターと進行管理者はお互いに最新のデータを保存することになり、Xserverのデータがなくなった際にも、個人PCのデータで進められる。&nbsp;</span><br>&nbsp;</li></ul>', '11,2,3', '2020-08-25 00:06:11', '2020-08-27 02:02:43'),
(23, 'P21 bị thiếu trong tệp PDF', '再校PDFファイルからP21が抜けました', '2020-03-24 10:23:00', '3', '68', NULL, NULL, 'ja', 1, 'Trouble', '<h4>Nội dung của sự cố</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Gock đã thực hiện \"công việc kết hợp\" của PDF, nhưng tại thời điểm đó, tôi đã giao nó cho YUIDEA mà không nhận thấy rằng 21 trang bị thiếu.</span></li></ul><h4>Nguyên nhân của rắc rối</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trước khi hợp nhất, tôi đã kiểm tra số lượng tài liệu và tệp PDF và kiểm tra xem tất cả các trang đã hoàn tất chưa.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Các thư mục được sắp xếp theo \"loại\" để tách các tài liệu PDF và InDesign. Tất cả các tệp PDF tách biệt đã được chọn và tệp kết hợp đã được tạo.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi đã hiển thị tệp PDF đã hoàn thành, nhưng tôi không xác nhận rằng số trang trong thanh công cụ của Acrobat là 24 trang cho tất cả các trang. Vì vậy, tôi đã không nhận thấy rằng 21 trang bị thiếu trong PDF. Có một số sai lầm trong hoạt động, nhưng việc thiếu xác nhận của gock là nguyên nhân chính lần này.</span></li></ul><h4>Làm cách nào để cải thiện</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi sẽ tuân theo các quy tắc về xác nhận của ông Miyano và làm việc theo đó. Tôi xin lỗi.</span></p>', '<h4>トラブルの内容</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">PDFの「結合作業」をゴックが行いましたが、その際、21ページが抜けていることに気づかずYUIDEAへ納品しました。</span></li></ul><h4>トラブルの原因</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">結合前に、ドキュメントとPDFの数を付き合わせて、全ページが揃っているかを確認しました。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">フォルダ内を「種類」でソートし、PDFとInDesignドキュメントを分別しました。 分別したPDFファイルを全部選択して、結合ファイルを作りました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">出来上がったPDFを表示しましたが、アクロバットのツールバーにあるページ数が全ページ分の24ページあることを確認しませんでした。 そのため、PDFから21ページが抜けたことに気が付きませんでした。 操作ミスもありますが、ゴックの確認不足が今回の主な原因です。&nbsp;</span></li></ul><h4>改善方法</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">宮野さんから教えていただいた確認のためのルールを守り、作業します。申し訳ありませんでした。</span></p>', '11,2,18,3', '2020-08-26 18:43:48', '2020-08-27 02:01:59'),
(24, '[4-5] Tệp PDF để gửi đã được tạo bằng dữ liệu cũ', '【4-5】納品用PDFファイルを古いデータで作成しました', '2020-04-06 10:46:00', '3', '69', NULL, NULL, 'ja', 1, 'Trouble', '<h4>Nội dung của sự cố</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Có 3 thành viên ở Việt Nam có thể làm việc trên \"Kinari Select\". Ai sẽ làm việc phụ thuộc vào số tiền thâm hụt được trả lại và tình hình kinh doanh. Hôm đó anh Tamura đồng ý nên tôi yêu cầu Trâm tạo PDF giao hàng.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trâm hiểu nhầm là \"không có chỉnh sửa\", mở thư mục \"Saikou\" và tạo bản PDF để gửi bằng tài liệu chưa chỉnh sửa trong thư mục \"INDD\" của trường lùi 1. Vào thời điểm đó, tôi mở hai hoặc ba tệp cùng một lúc và chọn \"Xuất\" từ menu \"Tệp\" để xuất PDF. Do đó, số lần xuất không theo thứ tự trang.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Ngọc làm một tệp PDF đã ghép và kiểm tra các dấu còn thiếu và điểm đặt trước chính xác. Tuy nhiên, tôi không nhận ra rằng nó đã lỗi thời vì tôi đã không kiểm tra các tài liệu tôi đã sử dụng.</span></li></ul><h4>Nguyên nhân của rắc rối</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi nghĩ rằng nguyên nhân của sự cố này là do lỏng lẻo, thiếu xác nhận và quản lý thư mục không đầy đủ.</span></li></ul><h4>Làm cách nào để cải thiện</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Sau đó, việc quản lý dữ liệu sẽ chỉ được thực hiện bởi quản lý tiến độ. Thay đổi như sau để cấu trúc thư mục dễ hiểu.</span></li></ul><p style=\"margin-left:40px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">├Kinari Select_kilala</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　├Job</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├KS_2020xxx</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├1.1st</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├2.Uchiko</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├_Final</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Uchikou 1</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Uchikou 2</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├3.Haneigo</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├4.Saikou</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├_Final</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Saikou 1</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Saikou 2 </span>&nbsp;</p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Quản lý tiến độ quản lý để tạo thư mục \"_Final\" và đưa dữ liệu mới nhất vào quá trình trả về rất nhiều. Nếu có hướng dẫn chỉnh sửa, chúng tôi sẽ hướng dẫn người vận hành sử dụng tài liệu tại đây, thao tác trên từng PC và khi đồng ý, hãy tải lại tài liệu tại đây. Điều này sẽ ngăn nhà điều hành xử lý sai dữ liệu.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi sẽ quyết định người kiểm soát dữ liệu của trường hợp và quản lý nó một cách chắc chắn. Kiểm tra lại dữ liệu trước khi yêu cầu công việc.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trước khi làm việc, người vận hành nên kiểm tra dữ liệu kỹ lưỡng trước khi bắt đầu công việc. Nếu bạn có bất kỳ câu hỏi nào, hãy yêu cầu người quản lý tiến độ hỏi bạn ngay lập tức.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Khi kiểm tra kiểm soát tiến độ, trước tiên hãy kiểm tra xem dữ liệu được sử dụng có chính xác không và so sánh với dữ liệu đã gửi ở giai đoạn trước.</span>&nbsp;<br>&nbsp;</li></ul>', '<h4>トラブルの内容</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">ベトナムには、「きなりセレクト」の作業を出来るメンバーが3人います。誰が作業するかは、戻しの赤字量、業務の状況によって決まります。 当日、田村さんからOKが出たのでTramに納品PDFの作成を依頼しました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tramは「修正がなかった」と勘違いし、「Saikou」フォルダを開き、再校戻し１の「INDD」フォルダの中の、修正前のドキュメントを使って、納品用PDFを作成しました。その際、２～３ファイルを同時に開き、「File」メニューの「Export」を選択し、PDFを書き出しました。このため、書き出した時間がページ順にはなりませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">NgocがPDFの合体ファイルを作り、マーク抜けと正しいプリセットを使ったかをチェックしました。しかし、使用したドキュメントを確認しなかったため、古いデータであることを気づきませんでした。</span></li></ul><h4>トラブルの原因</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;気の緩み、確認不足、フォルダ管理の不十分さが、今回のトラブルの原因だと思います。</span></li></ul><h4>改善方法</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">以降データ管理は進行管理のみでやっておきます。 フォルダ構成が分かりやすいように、下記の通りに変更します。</span></li></ul><p style=\"margin-left:40px;\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;├Kinari Select_kilala</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　├Job</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　├KS_2020xxx</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├1.1st</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├2.Uchiko</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├_Final</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Uchikou 1</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Uchikou 2</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├3.Haneigo</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　├4.Saikou</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├_Final</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Saikou 1</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;　　　　　　├Saikou 2&nbsp;</span></p><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">戻しが多いプロセスでは「_Final」フォルダを作って最新データを入れるように進行管理が管理します。修正指示があれば、オペレーターにこちらにあるドキュメントを使うように指示し、各PCで作業して、OKが出たら、再びこちらにアップしてもらいます。 こうすることでオペレーターのデータの取り扱いミスを防止できます。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">案件のデータ管理者を決め、しっかり管理します。作業を依頼する前には、再度データを確認します。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレーターは作業する前に、しっかりデータを確認した上で、作業を始めます。不明点があれば、すぐに進行管理に質問させます。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;進行管理のチェックの際には、使用したデータが正しいのかを最初に確認し、前段階に提出したものと比べます。&nbsp;</span><br>&nbsp;</li></ul>', '11,1,2,3', '2020-08-26 19:15:54', '2020-09-20 18:21:38'),
(25, '[5-1] Sau khi phản chiếu, hình ảnh của phần thiết kế trên trang bìa trở nên thô ráp', '【5-1】反映後、表紙のデザインパーツの画像が粗くなりました', '2020-04-09 11:26:00', '3', '113', NULL, NULL, 'ja', 1, 'Trouble', '<h4>Nội dung của sự cố</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Thứ sáu, ngày 3 tháng 4 [5-1] Hoàn nguyên trước khi phản chiếu 3</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Có một công việc để đưa một hình ảnh vào phần thiết kế của trang bìa.</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Sau lần kiểm tra đầu tiên, Ngọc hướng dẫn Diệp “chỉnh sửa tạo hình”. Diệp làm hình mới và lên bìa.</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Thông thường, lưu, xuất tệp PDF và đóng thiết kế trong (Tôi hướng dẫn bạn làm theo trình tự hoạt động này để tránh gặp rắc rối với \"Tsutsuna\").</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tuy nhiên, lần này, tôi đã xuất tệp PDF mà không lưu nó và nghĩ rằng nó đã được lưu, chọn \"Không lưu\" và đóng thiết kế trong thiết kế.</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Bản PDF ổn, vì vậy tôi đã gửi dữ liệu InDesign trước khi sửa đổi sang Nhật Bản.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Thứ Hai, ngày 6 tháng Tư [5-1] Sau khi phản ánh</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trâm đã làm bìa. Khi tôi mở tệp trong thiết kế, tôi nhận được thông báo \"cập nhật hình ảnh\", nhưng tôi đã không cập nhật tệp đó và làm việc mà không cập nhật.</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tôi đã kiểm tra bằng trình đọc mẫu, nhưng tôi không thể kiểm tra vì đó là bản chỉnh sửa không thay đổi nhiều so với bản PDF trước khi làm việc. Khi tôi kiểm tra tệp liên kết, tôi không nhận thấy rằng hình ảnh bị nhiễu hạt.</span></li></ul><h4>Nguyên nhân của rắc rối</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nguyên nhân là do Diệp đã sơ suất, báo cáo Trâm không đầy đủ, quản lý tiến độ thiếu kiểm tra.</span></li></ul><h4>Làm cách nào để cải thiện</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi sẽ sử dụng tập lệnh \"xuất PDF\" do ông Furooya tạo ra. Tập lệnh này sẽ cảnh báo bạn nếu tài liệu không được lưu, liên kết hình ảnh bị hỏng, thiếu phông chữ, v.v. Nếu tài liệu chưa được lưu, không thể xuất PDF. Từ bây giờ, khi công nhân viết bản PDF thử nghiệm, hãy đảm bảo sử dụng tập lệnh \"Xuất PDF\".</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trước khi tải lên dữ liệu, hãy đặt tài liệu và tệp PDF đã xác nhận thành một bộ và xác nhận ngày giờ. Nếu ngày giờ quá xa nhau, nhà mạng sẽ kiểm tra và thử lại. Nếu có bất kỳ thông báo cảnh báo hoặc những điểm chưa rõ ràng trong quá trình làm việc, hãy dừng công việc và báo cáo cho người quản lý tiến độ. Nếu bạn nằm ngoài phạm vi quyền hạn của người quản lý tiến độ, vui lòng liên hệ với người phụ trách YUIDEA (Mr. Saito).</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đó không phải là điều chúng tôi có thể làm ngay lập tức, nhưng chúng tôi sẽ có thể tuân theo các quy tắc và tuân theo các quy tắc trong khi kiểm tra quy trình cho mọi người trong nhóm DTP.</span>&nbsp;<br>&nbsp;</li></ul>', '<h4>トラブルの内容</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">４月３日（金）【5-1】反映前戻し３</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">表紙のデザインパーツに画像入れ作業がありました。</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">１回目のチェックのあとに、NgocがDiepに「画像作成の直し」を指示しました。 Diepが新しい画像作って、表紙に入れました。</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">通常は、保存して、PDFを書き出し、インデザインを閉じます(「常備菜」のトラブルの反省からこの操作順を守るように指示しています)。</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">しかし、今回は保存しないままPDFを書き出し、さらに、すでに保存したものと思い込み「保存しない」を選んで、インデザインを閉じました。&nbsp;</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">PDFがOKでしたので、修正前のInDesignデータを日本に送ってしまいました。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">４月６日（月） 【5-1】反映後</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Tramが表紙を作業しました。インデザインファイルを開くときに「画像更新」メッセージが出ましたが、進行管理に知らせずに、更新しないまま作業しました。</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">パタパタリーダー使ってチェックしましたが、作業まえのPDFとくらべて大きな変化のない修正であったためチェックできませんでした。 合体ファイルをチェックした際には、画像が粗くなっていることに気が付きませんでした。</span></li></ul><h4>トラブルの原因</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;Diepの保存ミス、Tramの報告不足、進行管理者のチェック不足が今回の原因です。&nbsp;</span></li></ul><h4>改善方法</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">古尾谷さんが作成した「PDF書き出し」スクリプトを使います。このスクリプトは、ドキュメントが保存されていない、画像リンクが外れている、フォントがないなどのとき、警告メッセージが出ます。ドキュメントが保存されなければ、PDFを書き出せない設定なっています。 今後、作業者が校正PDFを書き出すときには、必ず「PDF書き出し」スクリプトを使ってもらいます。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">データアップ前に、ドキュメントと確認したPDFをセットにして、日付と時間を確認します。日付と時間がかけ離れていたら、オペレータが確認し、再度アップを行います。 作業中に警告メッセージや不明なことがあれば、一旦作業止めて、進行管理者に報告します。進行管理者の権限範囲外の場合には、YUIDEAの案件担当者（斎藤さん）に連絡します。&nbsp;</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">すぐに完璧にできることではありませんが、フローを点検しつつ、DTPチームのメンバー全員でフォローして、ルールを守っていけるにします。&nbsp;</span><br>&nbsp;</li></ul>', '11,2,3', '2020-08-26 19:55:04', '2020-08-27 02:38:26'),
(26, 'Rắc rối với biển hiệu mini &quot;tôm, cua, sò&quot;', '「エビ・カニ・貝類」のミニ看板のトラブル', '2020-04-24 12:03:00', '3', '93', NULL, NULL, 'ja', 1, 'Trouble', '<h4>Nội dung của sự cố</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Trong tác phẩm mới của Tutsione số 121, định dạng cũ \"tôm, cua, sò\" đã được sử dụng thay cho định dạng bảng hiệu mini mới nhất \"tôm, cua, sò\".</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">◎ Ngày 17 tháng 4 (Thứ sáu)</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đã hoàn thành trang 18 của số báo danh 121 do Kim Ngọc phụ trách. Thanh kiểm tra và đưa cho Ngok.</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">◎ Ngày 20 tháng 4 (Thứ Hai)</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Ngọc đã kiểm tra tất cả các trang, nhưng không tìm thấy lỗi biển hiệu trên P18. Tôi đã giao nó cho Nhật Bản với một số sai sót.</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">◎ Thứ ba, ngày 20 tháng 4 11:50</span>&nbsp;<br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Một sai sót đã được phát hiện sau khi nộp bản sửa lỗi của trường đầu tiên cho phía Nhật Bản. Đã nhận được yêu cầu định dạng mới nhất từ phía Nhật Bản. Khi tôi kiểm tra dữ liệu mà tôi làm việc, tệp định dạng của Xserve 6 là định dạng mới nhất, nhưng định dạng được lưu trên PC cá nhân của Kim Ngọc và Nguyên không phải là dữ liệu mới nhất.</span></p><h4>Nguyên nhân</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Để đẩy nhanh tiến độ hoạt động, Nguyên sao chép các định dạng thường dùng trong máy tính cá nhân và làm thành văn bản tóm tắt.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Vào ngày 5 tháng 12 năm 2019, có một hướng dẫn cập nhật từ YUIDEA và bảng hiệu nơi bạn có thể nhập văn bản đã được cập nhật. Tuy nhiên, Nguyễn đã không cập nhật ký hiệu \"tôm, cua, sò\" trên tài liệu của mình.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nguyên đã chia sẻ với Kim Ngọc tài liệu mà Nguyên luôn sử dụng khi dạy người điều hành mới Kim Ngọc của mình về trường hợp của Tutsione.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Kim Ngọc vô tình sử dụng dữ liệu cũ, và người quản lý tiến độ cũng không hay biết là biển báo đã sai.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Vì người quản lý tiến độ đã hướng dẫn người điều hành sử dụng định dạng mới mỗi khi định dạng được cập nhật, anh ta đã bỏ qua việc kiểm tra vì cho rằng \"không nên sử dụng định dạng cũ\".</span>&nbsp;<br>&nbsp;</li></ul><h4>Làm cách nào để cải thiện</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Khi bạn làm việc, cả người điều hành và người quản lý tiến độ đảm bảo rằng các dấu hiệu ở định dạng mới nhất.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đảm bảo sao chép từ dữ liệu định dạng YUIDEA và sử dụng nó mà không sử dụng dữ liệu bạn đã biên dịch trên PC của riêng mình.</span>&nbsp;<br>&nbsp;</li></ul>', '<h4>トラブルの内容</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">ツチオーネ121号の新規作業で、最新のミニ看板のフォーマット「エビ・カニ・貝類」の代わりに、古いフォーマットの「エビ・カニ・貝」を使用 しました。</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">◎4月17日（金）</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;Kim Ngocが担当している121号の18ページを完成しました。Thanhがチェックして、ゴックに渡しました。</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;◎4月20日(月)&nbsp;</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Ngocが全頁チェックしましたが、P18の看板ミスを見つけられませんでした。ミスがあったまま、日本側に納品しました。</span></p><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;◎4月20日（火）11:50&nbsp;</span><br><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">初校戻しの修正を日本側へ提出した後、ミスが発覚しました。 日本側から最新フォーマットの要件を受け取りました。作業したデータを確認したところ、Xserve6のフォーマットファイルは最新フォーマットでしたが、Kim NgocとNguyenの個人ＰＣで保管されているフォーマットは最新データではありませんでした。</span></p><h4>原因</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Nguyenは操作を手早くするために、個人のＰＣにフォーマットの中でよく使うものをコピーして、それらをまとめたドキュメントを作っていました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">2019年12月5日にYUIDEAから更新指示があり、文言が入力できる看板が更新されました。しかし、Nguyenは、いつも使っているドキュメント上の「エビ・カニ・貝類」看板を更新しませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">&nbsp;Nguyenは新しいオペレーターのKim Ngocにツチオーネの案件を教える際、Nguyenがいつも使っているドキュメントをKim Ngocと共有しました。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Kim Ngocは意識しないうちに古いデータを使用し、 進行管理者はその看板が間違っていることに気が付きませんでした。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">進行管理者は、フォーマット更新の度にオペレーター新しいフォーマットを使うように指示していたので、「古いフォーマットを使用するはずがない」という思い込みもあり、チェックを怠ってしまいました。&nbsp;</span><br>&nbsp;</li></ul><h4>改善方法</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレーターと進行管理者のどちらも、作業時に、看板文字が最新フォーマットかどうかを確かめます。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">自分のPC上でまとめたものを使わずに、必ずYUIDEAのフォーマットデータからコピーし、使用します。&nbsp;</span><br>&nbsp;</li></ul>', '11,1,2,3,8', '2020-08-26 20:22:16', '2020-08-31 01:33:47'),
(27, 'p13 &quot;Eco Potato&quot;, thẻ con của khu vực sản xuất đã bị xóa', '「エコ・じゃがいも」の「産地の子タグ」が削除されました', '2020-06-19 12:22:00', '3', '170', NULL, NULL, 'ja', 1, 'Trouble', '<h4>Nội dung của sự cố</h4><ul><li>p13 Đã xóa thẻ gắn với văn bản \"khu vực sản xuất\" của \"khoai tây sinh thái\" và cập nhật hiệu chuẩn.</li><li>Khi YUIDEA thực hiện xử lý phản hồi, tôi nhận thấy thiếu thẻ và phát hiện ra lỗi.</li></ul><figure class=\"image\"><img src=\"http://jobtime.cetusvn.net/data/reports/hUv0bCh6dp4kWauEgenHPCwsbTRY3O0u3zTt83ZX.png\"></figure><h4>Nguyên nhân của rắc rối</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Người điều hành dán văn bản mà không mở \"trình chỉnh sửa câu chuyện\" khi thực hiện sửa đổi. Kết quả là, các thẻ đã biến mất.</span> Nó rất khó tìm do cấu trúc và tôi đã tải nó lên máy chủ mà không nhận thấy bất kỳ lỗi nào.</p><h4>Làm cách nào để cải thiện</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Đảm bảo mở \"Story Editor\" và sửa văn bản của khung sản phẩm. Hãy cẩn thận để làm theo quy tắc này.</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">Chúng tôi sẽ thêm chức năng kiểm tra tập lệnh xuất PDF để xem cấu trúc XML của Kinari Select có đúng hay không.</span></li></ul>', '<h4>トラブルの内容</h4><ul><li>p13「エコ・じゃがいも」の「産地」のテキストに付けられたタグを削除し校正をアップしました。</li><li>YUIDEAがフィードバック処理した際に、タグの不足に気が付きミスが発覚しました。</li></ul><figure class=\"image\"><img src=\"http://jobtime.cetusvn.net/data/reports/hUv0bCh6dp4kWauEgenHPCwsbTRY3O0u3zTt83ZX.png\"></figure><h4>トラブルの原因</h4><p><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">オペレータは修正時に「ストーリーエディタ」を開かずに、 テキストをペーストしてしまいました。その結果、タグが無くなりました。</span>構造上では見つけにくく、ミスに気が付くことなくサーバーへアップしました。</p><h4>改善方法</h4><ul><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">商品コマのテキストは、必ず「ストーリーエディタ」を開いてテキストを修正する。というルールをしっかり守るように注意いたします。</span></li><li><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,0);\">PDF書き出しのスクリプトに、KinariセレクトのXML構造が正しいかどうかのチェック機能を加えて運用します。</span></li></ul>', '11,2,3,8', '2020-08-26 22:31:21', '2020-08-31 01:34:34');
